import React from 'react';
import './App.css';
import Header from './components/Header';
import FeedSection from './components/FeedSection';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <FeedSection />
      </main>
    </div>
  );
}

export default App;
